import React from 'react'
import {
    BrowserRouter,
    Routes,
    Route,
} from 'react-router-dom';

const Navigation = () => {
  return (
    <BrowserRouter>
       <Route path="/" element={<Navigation />} />

    </BrowserRouter>
  )
}

export default Navigation
